import React, { useEffect, useState } from "react";

const Users = () => {
  let [user, setUser] = useState([]);
  useEffect(() => {
    fetch("http://localhost:4000/users")
      .then((data) => data.json())
      .then((elem) => setUser(elem));
  });

  return (
    <div>
      <div></div>
    </div>
  );
};

export default Users;
